import React, { useState } from 'react';
import './App.css';

function App() {

  const [count, setCount] = useState(0)

  return (
    <div className="App">
      <p>カウント: {count}</p>
      <Button btn_txt="クリックしろや"/>  
    </div>
  );
}

function Button (props) {
  return (
    <button>{props.btn_txt}</button>
  )
}

export default App;
